import styles from './Input.module.css'



const Input = (props) =>{


    return(
        <div className={styles.inputContainer}>
            <label htmlFor={props.input.id}>{props.label}</label>
            <input id={props.input.id} {...props.input} />
        </div>


    )
}

export default Input;
